  const items = useSelector((state: StateType) => state.items)
  const {fetchProducts} = useAxios()
  const {initialItems, loading, error} = useSelector((state: any) => state.items)
  console.log(initialItems, loading, error)

  useEffect(()=> {fetchProducts()}, [])
  
  return (
    <>
      {/* {loading ? <Loading /> */}
        {/* : */}
        <div>
          <Cart/>
          {items?.map((item: ProductsType) => <Item key={item.id} item={item} />)}
        </div>
        {/* } */}
    </>
  )
}
export default Items
